"use strict";self.addEventListener("fetch",function(n){n.respondWith(caches.open("restaurant-static-v1").then(function(e){return e.match(n.request).then(function(t){return t||fetch(n.request).then(function(t){return 404===t.status?fetch("/img/404error.gif"):(e.put(n.request,t.clone()),t)}).catch(function(){return new Response("Oh, the servers are down...")})})}))}),self.addEventListener("install",function(t){t.waitUntil(caches.open("restaurant-static-v1").then(function(t){return t.addAll(["/","min_js/combobox.js","min_css/styles.css","min_css/responsive.css"])}))}),self.addEventListener("activate",function(t){t.waitUntil(caches.keys().then(function(t){return Promise.all(t.filter(function(t){return t.startsWith("restaurant-")}).map(function(t){return caches.delete(t)}))}))});